package day8;

public class SwappingInt {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 1;
		int j = 45;
		int k = 0;
		k = i;
		i = j;
		j = k;
		System.out.println(i);
		System.out.println(j);
		int a = 78;
		int b = 97;
		a = a + b;
		b = a - b;
		a = a - b;
		System.out.println(a);
		System.out.println(b);
	}

}
